import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import archive from '../../assets/icons/albums.svg';
import Chip from '@material-ui/core/Chip';
import Card from '@material-ui/core/Card';

const useStyles = makeStyles((theme) => ({
  image: {
       width: '78px',
    height: '49px',
   },
  Card: {
    width: "370px",
    height: "324px",
    Background: "#FFFFFF 0% 0% no-repeat padding-box",
    boxShadow: "0px 12px 32px #383B470F",
    border: "0.23999999463558197px solid #DDDDDD80",
    borderRadius: "12px"
  },
  chip: {
    marginLeft: '116px'
  },
  paragraph: {
    font: "Regular 16px/24px PT Sans",
    letterSpacing: "0px",
    color: "#868E96",
    opacity: "1",
    height: '52px',
    width: "310px",
    justifyContent: 'center',
    marginLeft: '30px'
  }
}));

const Cards = (props) => {
  const classes = useStyles(props);

  return (
    <div className={classes.Card}>
      <img src={archive} alt="logo" className={classes.image} />
      <h4 className={classes.title}>District population</h4>
      <p className={classes.paragraph}>
        This should be used to tell a story and let your users know more
        about your service. How can you benefit them?
          </p>
      <Chip size="medium" color="primary" label="342+ DATASETS" className={classes.chip}></Chip>
    </div>
  );
}

export default Cards;
